window.bookSummaryJSON = "<p>Aubrey:<br> My life in Chicago was perfect. I had a great boyfriend, a great job, and an amazing apartment.<br> <br> Then it all went to shit and the city turned its back on me.<br> <br> Going home was my only option. Now the man that invaded my fantasies but avoided me for years is my new boss.</p> <p>Wolf:<br> She destroyed the walls I built to protect everyone and made me feel something.<br> Made me feel the urge to keep her safe, safe from me.<br> <br> And I did a damn good job.<br> <br> That is until her life implodes on my watch and I have to do everything to get her back to me and claim what has been mine all along.</p>"; 
